import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import Button from '@mui/material/Button';
import ShareIcon from '@mui/icons-material/Share';

import './Style.css';


function Navbar() {

  const customButtonStyle = {
    backgroundColor: 'your-custom-color', 
  };

    return (
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <a className="navbar-brand" href="/">Safaricom</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav">
            <li className="nav-item active">
              <a className="nav-link" href="/">Home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/about">Discover</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/contact">Exprience More</a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/contact">Testimonials</a>
            </li>
            <button type="button" className='signin' >
              Sign in
            </button>
            <Button
      variant="contained"
      sx={customButtonStyle}
      startIcon={<ShareIcon />}
    >
      Share
    </Button>
          </ul>
        </div>
      </nav>

    )
  }

export default Navbar
